COPY documenttype (id, category, code, title, description, source) FROM stdin;
1	basic	tenderNotice	Tender Notice	The formal notice that gives details of a tender. This may be a link to a downloadable document, to a web page, or to an official gazette in which the notice is contained.	
2	basic	awardNotice	Award Notice	The formal notice that gives details of the contract award. This may be a link to a downloadable document, to a web page, or to an official gazette in which the notice is contained.	
3	basic	contractNotice	Contract Notice	The formal notice that gives details of a contract being signed and valid to start implementation. This may be a link to a downloadable document, to a web page, or to an official gazette in which the notice is contained.	
4	basic	completionCertificate	Completion certificate		
5	basic	procurementPlan	Procurement Plan		
6	basic	biddingDocuments	Bidding Documents	Information for potential suppliers, describing the goals of the contract (e.g. goods and services to be procured), and the bidding process.	
7	basic	technicalSpecifications	Technical Specifications	Detailed technical information about goods or services to be provided.	
8	basic	evaluationCriteria	Evaluation Criteria	Information about how bids will be evaluated.	
9	intermediate	evaluationReports	Evaluation report	Report on the evaluation of the bids and the application of the evaluation criteria, including the justification fo the award	
10	intermediate	contractSigned	Signed Contract		
11	intermediate	contractArrangements	Arrangements for ending contract		
12	intermediate	contractSchedule	Schedules and milestones		
13	intermediate	physicalProcessReport	Physical progress reports	A report on the status of implementation, usually against key milestones.	
14	intermediate	financialProgressReport	Financial progress reports	Dates and amounts of stage payments made (against total amount) and the source of those payments, including cost overruns, if any. Structured versions of this data can be provided through transactions.	
15	intermediate	finalAudit	Final Audit		
16	intermediate	hearingNotice	Public Hearing Notice	Details of any public hearings that took place as part of the planning for this procurement.	
17	intermediate	marketStudies	Market Studies		
18	intermediate	eligibilityCriteria	Eligibility Criteria	Detailed documents about the eligibility of bidders.	
19	intermediate	clarifications	Clarifications to bidders questions	Including replies to issues raised in pre-bid conferences.	
20	intermediate	shortlistedFirms	Shortlisted Firms		
21	advanced	environmentalImpact	Environmental Impact		
22	advanced	assetAndLiabilityAssessment	Assesment of government’s assets and liabilities		
23	advanced	riskProvisions	Provisions for management of risks and liabilities		
24	advanced	winningBid	Winning Bid		
25	advanced	complaints	Complaints and decisions		
26	advanced	contractAnnexe	Annexes to the Contract		
27	advanced	contractGuarantees	Guarantees		
28	advanced	subContract	Subcontracts	A document detailing subcontracts, the subcontract itself, or a linked OCDS document describing a subcontract.	
29	advanced	needsAssessment	Needs Assessment		
30	advanced	feasibilityStudy	Feasibility study		
31	advanced	projectPlan	Project plan		
32	advanced	billOfQuantity	Bill Of Quantity		
33	advanced	bidders	Information on bidders	Information on bidders or participants, their validation documents and any procedural exemptions for which they qualify	
34	advanced	conflictOfInterest	conflicts of interest uncovered		
35	advanced	debarments	debarments issued		
\.
